export default {
    data ()
    {
        return{}
    },
    props: {
        user: {
            type:Object,
            required:true
        }
    },
    methods:{
        UserInfo(userId){
            this.$router.push(
                {
                    name: 'users',
                    params:
                    {
                        id: userId,
                        users: this.user
                    }
                }
            );
        }
    },
}
